import React from 'react'

function AppTodoList({ SetMyList, myList }) {
    console.log(myList)

    const handelClick = (index) => {
        const newList = [...myList]
        console.log("fwefwe",newList[index])
        newList[index].complete = true
        SetMyList(newList)
    }

    return (
    <div>

        {myList.map((myList, index) => (
            <div key={index} > 
                <button onClick={handelClick}>{myList.value}</button>
            </div>
        ))}
    </div>
  )
}

export default AppTodoList
